CREATE TABLE IF NOT EXISTS users_address (
    `key` INT,
    `properties_user_address_id` INT,
    `properties_user_address_street_address` VARCHAR(23) CHARACTER SET utf8,
    `properties_user_address_street_name` VARCHAR(19) CHARACTER SET utf8,
    `properties_user_address_street_sufix` VARCHAR(10) CHARACTER SET utf8,
    `properties_user_address_city` VARCHAR(18) CHARACTER SET utf8,
    `properties_user_address_city_prefix` VARCHAR(5) CHARACTER SET utf8,
    `properties_user_address_secondary_address` VARCHAR(9) CHARACTER SET utf8,
    `properties_user_address_address_direction` VARCHAR(9) CHARACTER SET utf8,
    `properties_user_address_state` VARCHAR(14) CHARACTER SET utf8,
    `properties_user_address_country` VARCHAR(44) CHARACTER SET utf8
);
